import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext';
import { LogOut, User, Home, Plus, Search } from 'lucide-react';

const Navbar = () => {
  const { user, isAuthenticated, logout } = useAuth();
  const navigate = useNavigate();

  const handleLogout = () => {
    logout();
    navigate('/');
  };

  return (
    <nav className="navbar">
      <div className="nav-container">
        <Link to="/" className="nav-logo">
          <Home size={24} />
          <span>RestaurantPortal</span>
        </Link>

        <div className="nav-menu">
          <Link to="/" className="nav-link">
            <Home size={18} />
            Home
          </Link>
          
          <Link to="/search-reviews" className="nav-link">
            <Search size={18} />
            Search Reviews
          </Link>

          {isAuthenticated ? (
            <>
              <Link to="/add-restaurant" className="nav-link">
                <Plus size={18} />
                Add Restaurant
              </Link>
              
              <Link to="/profile" className="nav-link">
                <User size={18} />
                Profile
              </Link>
              
              <div className="nav-user">
                <span className="nav-username">Hello, {user?.username}</span>
                <button onClick={handleLogout} className="nav-logout">
                  <LogOut size={18} />
                  Logout
                </button>
              </div>
            </>
          ) : (
            <div className="nav-auth">
              <Link to="/login" className="nav-link">
                Login
              </Link>
              <Link to="/register" className="nav-link nav-register">
                Register
              </Link>
            </div>
          )}
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
